import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <h1>QR CODE QENARETOR</h1>
      <img src="" alt="" />
      <div>
        <label htmlFor="dataInput" className="inputlabel">Data for QR code</label>
        <input type="text" id="dataInput" />
        <label htmlFor="sizeInput" className="inputlabel">Image size</label>
        <input type="text" id="sizeInput" />
        <button className="genarete_button">Generate QR code</button>
        <button className="download_button">Download QR code</button>
      </div>
      <p>Designed by Muthupandi Raj</p>
    </div>
  );
}

export default App;
